import React from "react";
import ReactDOM from "react-dom";
import "./main.css";

function header() {
  return (
    <header className="wraper">
      <div className="header">
        <img
          className="productimage"
          src="product.png"
          alt="producthunt"
          width="50"
        />
        <input
          className="search"
          type="text"
          placeholder="Discover your next favorite thing..."
        />
        <div className="navmenu">
          <a className="tags" href="#">
            {" "}
            Deals{" "}
          </a>{" "}
          <a className="tags" href="#">
            {" "}
            jobs{" "}
          </a>{" "}
          <a className="tags" href="#">
            {" "}
            Makers{" "}
          </a>{" "}
          <a className="tags" href="#">
            {" "}
            Radio{" "}
          </a>{" "}
          <a className="tags" href="#">
            {" "}
            Ship{" "}
          </a>{" "}
          <a className="tags" href="#">
            {" "}
            ...{" "}
          </a>{" "}
        </div>{" "}
        <div className=" button">
          <button className="login"> Login </button>{" "}
          <button className="signup"> Signup </button>{" "}
        </div>{" "}
      </div>{" "}
    </header>
  );
}

function App() {
  return (
    <div className="whole-part">
      <div className="first">
        <img src="event.jpeg" alt="event" width="80" />
        <div className="headpara">
          <h2> Coders Rank </h2> <p> The ultimate profile for developers </p>{" "}
        </div>{" "}
      </div>{" "}
      <hr> </hr>{" "}
      <div className="first">
        <img src="games.png" alt="games" width="80" />
        <div className="headpara">
          <h2> Game world </h2> <p> Free and Seperate budgetting </p>{" "}
        </div>{" "}
      </div>{" "}
      <hr> </hr>{" "}
      <div className="first">
        <img src="ship.jpeg" alt="ship" width="80" />
        <div className="headpara">
          <h2> Ship.com </h2>{" "}
          <p> A new way to track, ship and sharepackeges from your phone </p>{" "}
        </div>{" "}
      </div>{" "}
    </div>
  );
}

ReactDOM.render(App(), document.getElementById("root"));
ReactDOM.render(header(), document.getElementById("main"));
